import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div className="App">
      console.log("something");
      <header className="App-header">
      <p>
        React Starter UI Template For Electronic Ecommerce web based app
        <br/>
        <br/>
        </p>
        <img src={logo} className="App-logo" alt="logo" />

      </header>
    </div>
  );
}

export default App;
